import React from 'react'
import Navbar from '../../navbar/Navbar';
import { useState,useEffect } from 'react';
import axios from 'axios';
import "./kekkeiGenkai.scss"

import boilReleaseImage from "../../kekkeiGenkaiImages/boilRelease.png"
import byakuganImage from "../../kekkeiGenkaiImages/byakugan.png"
import crystalReleaseImage from "../../kekkeiGenkaiImages/crystalRelease.png"
import mangekyoReleaseImage from "../../kekkeiGenkaiImages/boilRelease.png"
import explosionReleaseImage from "../../kekkeiGenkaiImages/boilRelease.png"
import iburiClanKekkiIemage from "../../kekkeiGenkaiImages/boilRelease.png"
import iceReleaseImage from "../../kekkeiGenkaiImages/boilRelease.png"
import isshikiDojutsuImage from "../../kekkeiGenkaiImages/boilRelease.png"
import joganImage from "../../kekkeiGenkaiImages/boilRelease.png"
import jugoClanImage from "../../kekkeiGenkaiImages/boilRelease.png"
import ketsuryuganmage from "../../kekkeiGenkaiImages/boilRelease.png"
import kuramaClanImage from "../../kekkeiGenkaiImages/boilRelease.png"
import lavaReleaseImage from "../../kekkeiGenkaiImages/boilRelease.png"
import magnetReleaseImage from "../../kekkeiGenkaiImages/boilRelease.png"



const KekkeiGenkai = () => {

    const [kekkeiGenkai,setKekkeiGenkai] = useState([]);
    const key = "kekkei-genkai"
    useEffect(() =>{
        const fetchAllKekkeiGenkai = async () =>{
        try {
            const res = await axios.get("https://dattebayo-api.onrender.com/kekkei-genkai");
            setKekkeiGenkai(res.data[key]);
            console.log(res.data[key]);
        } catch (error) {
            console.error(error);
        }
        }
        fetchAllKekkeiGenkai();
    },[])
    let id = null;



    return (
        <div>
        <div><Navbar/></div>
        <h1>Kekkei Genkai</h1>
        <div className="kekkeiGenkaiWrapper">
        {kekkeiGenkai.map(kekkeiGenkaiItem=>(
            <div className="kekkeiGenkaiItemBox" key={kekkeiGenkaiItem.id}>

                        <div className="kekkeiGenkaiName">{kekkeiGenkaiItem.name}</div>
                        <div className="kekkeiGenkaiImage">
                        {(() => {
                            switch (kekkeiGenkaiItem.id) {
                            case 0:
                                return <img src={boilReleaseImage} />;
                            case 1:
                                return <img src={byakuganImage} />;
                            case 2:
                                return <img src={crystalReleaseImageImage} />;
                            case 3:
                                return <img src={byakuganImage} />;
                            case 4:
                                return <img src={byakuganImage} />;
                            case 5:
                                return <img src={byakuganImage} />;
                            case 6:
                                return <img src={byakuganImage} />;
                            case 7:
                                return <img src={byakuganImage} />;
                            case 8:
                            case 9:
                            case 10:
                            case 11:
                            case 12:
                            case 13:
                            case 14:
                            case 15:
                            case 16:
                            case 17:
                            case 18:
                            case 19:
                            default:

                                return null;
                            }
                        })()}

                        </div>



                </div>
            ))}

        </div>
    </div>
  )
}

export default KekkeiGenkai
